Sample = "leeeeetcode"
Sample2 = ""

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        source = 0
        if len(s) == 0: #if the length of s is zero then it always fits into T
            return True
        for target in range(len(t)): #for each character in T
            if s[source] == t[target]: #if the nth character of s is in T move on to the next character in s
                source +=1
            if source == len(s): #if all the letters collected in source = the length of s then it must be true
                return True
        return False #if none of these are true then it must be false
    # this would iterate through a test case as 
    # sample = abc sample2 = agdcgjb
    # A == sample[0] so go to the next character in sample
    # b == sample[0] so go to the next character in sample
    # it would not access C because it comes before B so source will not equal length(sample) meaning this will return false

